      out.write("\t\t\t\t\t<button type=\"button\" class=\"collapsible\"><span style = \"color:red;\">[필수]</span> 이용약관 동의</button>\r\n");
      out.write("\t\t\t\t\t<div class=\"person-content\">\r\n");
      out.write("\t\t\t\t\t\t<p>제 1 조 (목적)\r\n");
      out.write("\t\t\t\t\t\t\t\t본 약관은 KHGROUPWARE (이하 \"회사\")가 운영하는 \"서비스\"를 이용함에 있어 \"회사\"와 회원간의 이용 조건 및 제반 절차, 권리, 의무 및 책임사항, 기타 필요한 사항을 규정함을 목적으로 한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t제 2 조 (용어의 정의)\r\n");
      out.write("\t\t\t\t\t\t\t\t이 약관에서 사용하는 용어의 정의는 아래와 같다.\r\n");
      out.write("\t\t\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t\t\t\t① \"사이트\"라 함은 회사가 서비스를 \"회원\"에게 제공하기 위하여 컴퓨터 등 정보통신설비를 이용하여 설정한 가상의 영업장 또는 회사가 운영하는 웹사이트, 모바일웹, 앱 등의 서비스를 제공하는 모든 매체를 통칭하며, 통합된 하나의 회원 계정(아이디 및 비밀번호)을 이용하여 서비스를 제공받을 수 있는 아래의 사이트를 말한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t- www.khgroupware.co.kr\r\n");
      out.write("\t\t\t\t\t\t\t\t- https://www.iei.or.kr\r\n");
      out.write("\t\t\t\t\t\t\t\t- www.campusmon.com\r\n");
      out.write("\t\t\t\t\t\t\t\t- m.jobkorea.co.kr\r\n");
      out.write("\t\t\t\t\t\t\t\t- m.albamon.com\r\n");
      out.write("\t\t\t\t\t\t\t\t- learning.jobkorea.co.kr\r\n");
      out.write("\t\t\t\t\t\t\t\t② \"서비스\"라 함은 회사가 운영하는 사이트를 통해 개인이 구직, 교육 등의 목적으로 등록하는 자료를 DB화하여 각각의 목적에 맞게 분류 가공, 집계하여 정보를 제공하는 서비스와 사이트에서 제공하는 모든 부대 서비스를 말한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t③ \"회원\"이라 함은 \"회사\"가 제공하는 서비스를 이용하거나 이용하려는 자로, 페이스북 등 외부 서비스 연동을 통해 \"회사\"와 이용계약을 체결한자 또는 체결하려는 자를 포함하며, 아이디와 비밀번호의 설정 등 회원가입 절차를 거쳐 회원가입확인 이메일 등을 통해 회사로부터 회원으로 인정받은 \"개인회원\"을 말한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t④ \"아이디\"라 함은 회원가입 시 회원의 식별과 회원의 서비스 이용을 위하여 \"회원\"이 선정하고 \"회사\"가 부여하는 문자와 숫자의 조합을 말한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t⑤ \"비밀번호\"라 함은 위 제4항에 따라 회원이 회원가입시 아이디를 설정하면서 아이디를 부여받은 자와 동일인임을 확인하고 \"회원\"의 권익을 보호하기 위하여 \"회원\"이 선정한 문자와 숫자의 조합을 말한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t⑥ \"비회원\"이라 함은 회원가입 절차를 거치지 않고 \"회사\"가 제공하는 서비스를 이용하거나 하려는 자를 말한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t제 3 조 (약관의 명시와 개정)\r\n");
      out.write("\t\t\t\t\t\t\t\t① \"회사\"는 이 약관의 내용과 상호, 영업소 소재지, 대표자의 성명, 사업자등록번호, 연락처 등을 \"회원\"이 알 수 있도록 초기 화면에 게시하거나 기타의 방법으로 \"회원\"에게 공지해야 한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t② \"회사\"는 약관의 규제에 관한 법률, 전기통신기본법, 전기통신사업법, 정보통신망 이용촉진 및 정보보호 등에 관한 법률 등 관련법을 위반하지 않는 범위에서 이 약관을 개정할 수 있다.\r\n");
      out.write("\t\t\t\t\t\t\t\t③ \"회사\"가 약관을 개정할 경우에는 적용일자 및 개정사유를 명시하여 현행약관과 함께 그 개정약관의 적용일자 7일 전부터 적용일자 전일까지 공지한다. 단 \"회원\"의 권리, 의무에 중대한 영향을 주는 변경의 경우에는 적용일자 30일 전부터 공지하도록 한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t④ \"회원\"은 변경된 약관에 대해 거부할 권리가 있다. \"회원\"은 변경된 약관이 공지된 지 15일 이내에 거부의사를 표명할 수 있다. \"회원\"이 거부하는 경우 본 서비스 제공자인 \"회사\"는 15일의 기간을 정하여 \"회원\"에게 사전 통지 후 당해 \"회원\"과의 계약을 해지할 수 있다. 만약, \"회원\"이 거부의사를 표시하지 않거나, 전항에 따라 시행일 이후에 \"서비스\"를 이용하는 경우에는 동의한 것으로 간주한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t제 4 조 (약관의 해석)\r\n");
      out.write("\t\t\t\t\t\t\t\t① 이 약관에서 규정하지 않은 사항에 관해서는 약관의 규제에 관한 법률, 전기통신기본법, 전기통신사업법, 정보통신망 이용촉진 및 정보보호 등에 관한 법률 등의 관계법령에 따른다.\r\n");
      out.write("\t\t\t\t\t\t\t\t② 각 사이트 및 서비스 이용약관이 있는 경우에는 서비스 이용약관이 우선한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t③ \"회원\"이 \"회사\"와 개별 계약을 체결하여 서비스를 이용하는 경우에는 개별 계약이 우선한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t제 5 조 (이용계약의 성립)\r\n");
      out.write("\t\t\t\t\t\t\t\t① \"회사\"의 서비스 이용계약(이하 \"이용계약\")은 서비스를 이용하고자 하는 자가 본 약관과 개인정보처리방침을 읽고 \"동의\" 또는 \"확인\" 버튼을 누른 경우 본 약관에 동의한 것으로 간주한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t② 제1항 신청에 있어 \"회사\"는 \"회원\"의 종류에 따라 전문기관을 통한 실명확인 및 본인인증을 요청할 수 있으며, \"회원\"은 본인인증에 필요한 이름, 생년월일, 연락처 등을 제공하여야 한다.\r\n");
      out.write("\t\t\t\t\t\t\t\t③ \"회원\"이 이용신청(회원가입 신청) 작성 후에 \"회사\"가 웹상의 안내 및 전자메일로 \"회원\"에게 통지함으로써 이용계약이 성립된다.\r\n");
      out.write("\t\t\t\t\t\t\t\t④ 페이스북 등 외부 서비스와의 연동을 통해 이용계약을 신청할 경우, 본 약관과 개인정보처리방침, 서비스 제공을 위해 \"회사\"가 \"회원\"의 외부 서비스 계정 정보 접근 및 활용에 \"동의\" 또는 \"확인\" 버튼을 누르면 \"회사\"가 웹상의 안내 및 전자메일로 \"회원\"에게 통지함으로써 이용계약이 성립된다.\r\n");
